import { useState, useEffect } from "react";

export const Test = () => {
  const [test, setTest] = useState("initial");

  useEffect(() => {
    try {
      fetch("/api", {
        method: "GET",
      })
        .then((res) => console.log(res.json()))
        .then((data) => setTest(data));
    } catch (error) {
      console.log("error =>", error);
    }
  }, [test]);

  return <h1>{test}</h1>;
};
